MAX = 1_000_000_007
def sum_subarray_mins(a)
  left_stack, right_stack = [], []
  left_min, right_min = [], []
  0.upto(a.length - 1) do |idx|
    left_min[idx] = idx + 1
    right_min[idx] = a.length - idx
  end

  0.upto(a.length - 1) do |idx|
    left_stack.pop while !left_stack.empty? && a[left_stack.last] > a[idx]
    left_min[idx] = left_stack.empty? ? idx + 1 : idx - left_stack.last
    left_stack.push(idx)

    while !right_stack.empty? && a[right_stack.last] > a[idx]
      other_idx = right_stack.pop
      right_min[other_idx] = idx - other_idx
    end
    right_stack.push(idx)
  end
  sum = 0
  0.upto(a.length - 1) do |idx|
    sum += right_min[idx] * left_min[idx]  * a[idx]
  end
  sum % MAX
end


MAX = 1_000_000_007
def sum_subarray_mins(a)
  sum, dot, stack = 0, 0, []
  a.each_with_index do |num, idx|
    count = 1
    while !stack.empty? && stack.last.first > num
      prev, prev_count = stack.pop
      count += prev_count
      dot -= prev * prev_count
    end
    stack.push([num, count])
    dot += num * count
    sum = (sum + dot) % MAX
  end
  sum
end
